import React from "react";
import "./Menu.css";
import { pizzas } from "../../storage/pizzaMenu";
import { IPizza } from "../../helpers/interfaces/IPizza";

//Import Components
import Navbar from "../../components/Navbar/Navbar";
import Card from "../../components/Card/Card";
import Footer from "../../components/Footer/Footer";

const Menu = () => {
  return (
    <>
      <Navbar />
      <div className="cardContainer">
        {pizzas.map((pizza: any, key: number) => {
          return (
            <Card key={key} name={pizza.name} ingredients={pizza.ingredients} />
          );
        })}
      </div>
      <Footer />
    </>
  );
};

export default Menu;
